def rechnen():
    dateiName = filename
    datum_start = int(datumanfang.get())
    datum_end = int(datumende.get())
    zeit_start = int(zeitanfang.get())
    zeit_end = int(zeitende.get())

    boxen = []
    if(box0.state()):
        boxen.append(0)
    if(box1.state()):
        boxen.append(1)
    if(box2.state()):
        boxen.append(2)
    if(box3.state()):
        boxen.append(3)
    if(box4.state()):
        boxen.append(4)
    if(box11.state()):
        boxen.append(11)

    root.destroy()

    print(dateiName)
    print(datum_start)
    print(datum_end)
    print(zeit_start)
    print(zeit_end)
    print(boxen)

    #---------------------------------------------------------
    #---------------------------------------------------------
    print("Lade Bibliotheken")

    import csv #zum lesen der cvs datei
    import time #falls ich ne pause brauch

    start_time = time.time()

      
    print(boxen)


    print("von " + str(datum_start) + " " + str(zeit_start) + " bis " + str(datum_end) + " " + str(zeit_end))

    print("Lese Messwerte ein (kann ein paar Sekunden dauern)" + "    " + str(time.time() - start_time))

    with open(dateiName, 'r') as infile, open(r'bereinigt.csv', 'w') as outfile:
        data = infile.read()
        data = data.replace("-", "")
        data = data.replace(":", "")
        data = data.replace('"', "")
        outfile.write(data)


    datafile = open("bereinigt.csv", 'r')
    datareader = csv.reader(datafile, delimiter=',')
    data = []
    for row in datareader:
        data.append(row)

    print("Größe: " + str(len(data)) + "    " + str(time.time() - start_time))
    #print(data)

    print("Erstelle berthold(4d liste)" + "    " + str(time.time() - start_time))

    berthold = []  #4d liste in der x, y, und alle liesten der messungen fürs kästchen

    for a in range(350):
        berthold.append([])
        for b in range(250):
            berthold[a].append([])
        
    #print(berthold)

    print("Einordnen der Messungen in berthold (kann ein paar Sekunden dauern)" + "    " + str(time.time() - start_time))

    for c in range(len(data)):
        #print("------------------------------------------")
        #print(c)
        #print(data[c])

        condition1 = 8.28 < float(data[c][4]) < 8.52
        condition2 = 48.97 < float(data[c][3]) < 49.08
        condition3 = int(data[c][0]) in boxen
        condition4_1 = datum_start < int(data[c][1]) < datum_end
        condition4_2 = (int(data[c][1]) == datum_start) and (int(data[c][2]) >= zeit_start)
        condition4_3 = (int(data[c][1]) == datum_end) and (int(data[c][2]) <= zeit_end)
        condition4 = condition4_1 or condition4_2 or condition4_3

        if condition1 and condition2 and condition3 and condition4:
            x = int((float(data[c][4]) - 8.28) / (0.24/350))
            y = int((float(data[c][3]) - 48.97) / (0.11/250))
            #print(x)
            #print(y)
            berthold[x][y].append(data[c])

    #print(berthold)
    '''
    print("Speichern von berthold in Textdatei (kann ein paar Sekunden dauern)" + "    " + str(time.time() - start_time))

    with open('berthold.txt', 'w') as f:
        print(berthold, file=f)
    
    '''
    print("Erstelle bettina(3d liste)" + "    " + str(time.time() - start_time))

    bettina = []  #3d liste in der x, y, und alle durchschnitte der messungen fürs kästchen

    for d in range(350):
        bettina.append([])
        for e in range(250):
            bettina[d].append([])

    print("Durchschnitte für kästchen aus berthold ausrechnen und in bettina einsetzten (kann ein paar Sekunden dauern)" + "    " + str(time.time() - start_time))


    for g in range(350):
        for h in range(250):
            #print(g, h)
            avg_2_5 = []
            avg_10 = []
            pm2_5 = 0
            pm10 = 0
            if len(berthold[g][h]) >= 3:
                for i in range(len(berthold[g][h])):
                    avg_2_5.append(float(berthold[g][h][i][5]))
                    avg_10.append(float(berthold[g][h][i][6]))
                #michels ultimative funktion
                avg_2_5.sort()
                avg_10.sort()
                del avg_2_5[0:(int(len(avg_2_5)/10)+1)]
                del avg_10[0:(int(len(avg_10)/10)+1)]
                del avg_2_5[((len(avg_2_5)-(int(len(avg_2_5)/10)+1))):(len(avg_2_5))]                         
                del avg_10[((len(avg_10)-(int(len(avg_10)/10)+1))):(len(avg_10))]
                #
                pm2_5 = float(sum(avg_2_5) / len(avg_2_5))
                pm10 = float(sum(avg_10) / len(avg_10))
                bettina[g][h].append(pm2_5)
                bettina[g][h].append(pm10)



    #print("banjamin wird durch bettina erzeugt" + "    " + str(time.time() - start_time))

    benjamin = "x, y, pm2.5, pm10, Anzahl_Messpunkte, baume, kreuzung, wald, park, idustrie, ampel" +"\n" #Ein String in dem die auszugebene csv datei gespeichert wird

    anzahl = 0

    for j in range(350):
        for k in range(250):
            if bettina[j][k]:
                anzahl = anzahl + len(berthold[j][k])
                kreuzung = kreuzungen[j][k]
                ampel = ampeln[j][k]
                if kreuzung > 1:
                    kreuzung = 1
                if ampel > 1:
                    ampel = 1
                benjamin = benjamin + str((j * (0.24/350))+8.28+((0.24/350)/2)) + "," + str((k * (0.11/250))+48.97+((0.11/250)/2)) + "," + str(round(bettina[j][k][0], 1)) + "," + str(round(bettina[j][k][1], 1)) + "," + str(len(berthold[j][k])) + "," + str(baume[j][k]) + "," + str(kreuzung) + "," + str(forest[j][k]) + "," + str(park[j][k]) + "," + str(industrial[j][k]) + "," + str(ampel) +"\n"


    print("Es wurden " + str(anzahl) + " Messpunkte verarbeitet")

    print("benjamin wird gespeichert" + "    " + str(time.time() - start_time))
        
    with open('output.csv', 'w') as f:
        print(benjamin, file=f)

            
            
    print("Fertig" + "    " + str(time.time() - start_time))


